/**
 * 控制台输出信息
 * @param args - 信息
 */
export async function print(...args) {
    const processedArgs = args.map(arg => {
        if (arg instanceof Response) {
            // 如果是 Response 对象，直接交给 console.log 处理
            return arg;
        } else if (typeof arg === 'object') {
            // 如果是对象，使用 JSON.stringify 进行格式化
            return JSON.stringify(arg, null, 2);
        } else {
            return arg;
        }
    });
    console.log(...processedArgs);
}

/**
 * 从列表中提取属性列表
 * @param list - 列表
 * @param attr - 属性
 * @returns 
 */
export function getAttrList(list, attr) {
    let result = [];
    for (let l of list) {
        let memosId = l[attr];
        result.push(memosId);
    }
    return result;
}

/**
 * 空字典判断
 * @param obj 
 * @returns 
 */
export function isObjectEmpty(obj) {
    return Object.keys(obj).length === 0;
}

